  CONSTRAINT `Especialidade_Mapeamento_especialidade_normalizada_fkey` FOREIGN KEY (`especialidade_normalizada`) REFERENCES `prod_especialidade` (`nome`) ON DELETE RESTRICT ON UPDATE CASCADE
